class Solution:
    def intersect(nums1, nums2):

        if len(nums1) > len(nums2):
            nums1, nums2 = nums2, nums1

        output = []

        while len(nums1) > 0:

            if nums1[0] in nums2:
                output.append(nums1[0])
                nums2.pop(nums2.index(nums1[0])), nums1.pop(0)
                continue

            nums1.pop(0)

        return output
